import React from 'react';
import web from '../src/images/dt.jpg';


const Card = () => {
  return (
    <>
    <div className='my-5'>
    <h1  className='text-center'>Our Services</h1>
    </div>
    <div className='container-fluid mb-5'>
        <div className='row'>
            <div className='col-10 mx-auto'>
              <div className='row'>
                <div className='col-md-4 col-10 mx-auto'>
                <div class="card" >
  <img src={web} class="card-img-top" alt="..."/>
  <div class="card-body">
    <h5 class="card-title">Seminar</h5>
    <p class="card-text">Are you ready to take your personal and professional life to the next level.</p>
    <NavLink href="#" class="btn btn-primary">view details</NavLink>
  </div>
</div>
                </div>

              </div>
  </div>
      </div>
            </div>
    </>
  );
};

export default Card;
